         <div className="kpi-slider">
      <div className="kpi-slider-content">
        <button className="close-button" onClick={onClose}>X</button>
        <h2>Update KPI Priority</h2>
        {/* Add your form or content here */}
      </div>
    </div>
    </div>
  )
}
